import React from 'react';
import { useMoralis } from "react-moralis";

import telegramIcon from "../assets/telegram.svg"

const Footer = ({ height, text }: any) => {
    const { authenticate, logout, isAuthenticated, user } = useMoralis();


    return (
        <footer>
            <section className="next bg-black h-80">
                <div className="grid grid-cols-3 gap-8">
                </div>
                <img src={telegramIcon} alt="" className="w-4 h-4" />
                <div className="flex flex-0 md:gap-80 gap-8 p-8 ">
                    <button className={"font-bold md:text-1xl bg-red-600 flex-1  z-10 font-semibold rounded-lg shadow-md text-black bg-black h-12"} onClick={() => null}>{"Discord"}</button>
                    <button className={"font-bold md:text-1xl bg-red-600 flex-1  z-10 font-semibold rounded-lg shadow-md text-black bg-black h-12"} onClick={() => null}>{"Telegram"}</button>
                </div>
            </section>
        </footer>
    );
}
export default Footer;
